import * as React from "react";
import RabbitCityDialog from "./RabbitCityDialog";

interface IRabbitCityState {
  isShowingDialog: boolean;
  isHidingDialog: boolean;
  dialogX: number;
  dialogY: number;
}

class RabbitCity extends React.Component<{}, IRabbitCityState> {
  constructor(props: {}) {
    super(props);
    this.state = {
      isShowingDialog: false,
      isHidingDialog: false,
      dialogX: 0,
      dialogY: 0
    };
    this.onMouseEnterHandler = this.onMouseEnterHandler.bind(this);
    this.onMouseMoveHandler = this.onMouseMoveHandler.bind(this);
    this.onMouseLeaveHandler = this.onMouseLeaveHandler.bind(this);
  }

  public render() {
    return (
      <div className="rabbit-city-wrapper city-wrapper">
        <svg
          className="rabbit-city city"
          xmlns="http://www.w3.org/2000/svg"
          version="1.1"
          x="0px"
          y="0px"
          viewBox="0 0 514 404"
        >
          <a
            onMouseMove={this.onMouseMoveHandler}
            onMouseEnter={this.onMouseEnterHandler}
            onMouseLeave={this.onMouseLeaveHandler}
          >
            <image
              id="兔子村"
              width="514"
              height="404"
              xlinkHref="data:img/png;base64,"
            />
          </a>
        </svg>
        <RabbitCityDialog
          isShowingDialog={this.state.isShowingDialog}
          isHidingDialog={this.state.isHidingDialog}
          dialogX={this.state.dialogX}
          dialogY={this.state.dialogY}
        />
      </div>
    );
  }

  private onMouseEnterHandler(event: React.MouseEvent<HTMLElement>): void {
    this.setState({
      isShowingDialog: true,
      isHidingDialog: false
    });
  }

  private onMouseMoveHandler(event: React.MouseEvent<HTMLElement>): void {
    this.setState({
      dialogX: event.nativeEvent.offsetX,
      dialogY: event.nativeEvent.offsetY
    });
  }

  private onMouseLeaveHandler(event: React.MouseEvent<HTMLElement>) {
    this.setState({
      isShowingDialog: false,
      isHidingDialog: true
    });
  }
}

export default RabbitCity;
